import "./Login.scss";
import "./Responsive.scss";

import { LoginOutlined } from "@ant-design/icons";
import Context from "@ant-design/icons/lib/components/Context";
import { Button, Checkbox, Col, Form, Input, Row, notification } from "antd";
import type { NotificationPlacement } from 'antd/es/notification/interface';
import axios from "axios";

function Login() {
  const openNotification = (placement: NotificationPlacement) => {
    const [api, contextHolder] = notification.useNotification();

    api.info({
      message: `Notification ${placement}`,
      description: <Context.Consumer>{({ name }) => `Hello, ${name}!`}</Context.Consumer>,
      placement,
    });
  }
  const onFinish = (values: any) => {
    console.log("Success:", values);
    axios
      .post("http://192.168.2.224:9099/api/auth/signin", values)
      .then((data) => {
        console.log(data);
        const accessToken = data.data.data.token;
        localStorage.setItem("access_token", accessToken);
      });
  };

  const onFinishFailed = (errorInfo: any) => {
    console.log("Failed:", errorInfo);
  };

  return (
    <div className="App">
      <Row style={{ height: "100%" }}>
        <Col span={12} xs={24} sm={12}>
          <div className="register register-left">
            <div className="title">
              <img
                src="https://cdn.haitrieu.com/wp-content/uploads/2022/06/Logo-Thanh-Pho-Da-Nang.png"
                alt="logo DA NANG city"
              />
              <h2>KHO KẾT QUẢ THỦ TỤC HÀNH CHÍNH SỐ</h2>
            </div>

            <Form
              name="basic"
              labelCol={{ span: 24 }}
              wrapperCol={{ span: 0 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              autoComplete="off"
            >
              <Form.Item
                label="Tên đăng nhập"
                name="username"
                rules={[
                  { required: true, message: "Vui lòng nhập tên đăng nhập!" },
                ]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="Mật khẩu"
                name="password"
                rules={[{ required: true, message: "Vui lòng nhập mật khẩu!" }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item
                name="remember"
                valuePropName="checked"
                wrapperCol={{ offset: 0, span: 11 }}
              >
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  type="primary"
                  htmlType="submit"
                  style={{ width: "100%" }}
                >
                  <LoginOutlined />
                  Đăng nhập
                </Button>
              </Form.Item>
              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  htmlType="submit"
                  style={{
                    width: "100%",
                    backgroundColor: "#ff8f18",
                  }}
                  type="primary"
                >
                  Đăng nhập bằng tài khoản công dân số
                </Button>
              </Form.Item>
            </Form>
          </div>
        </Col>
        <Col span={12} xs={24} sm={12} className="col-right">
          <div className="register register-right"></div>
        </Col>
      </Row>
    </div>
  );
}

export default Login;
